import React, { useState } from 'react';
import { View, Image, ImageBackground, StyleSheet, Text, TextInput, SafeAreaView, Linking, TouchableOpacity } from 'react-native';
import { RectButton } from 'react-native-gesture-handler';
import { useNavigation } from '@react-navigation/native';

import styles from './estilo';
import styleGeral from '../estiloGeral/style'

export default function tSelecaoUser() {

    const navigation = useNavigation()

    function CriarUsuario() {
        navigation.navigate('tCadastroInfoU');
    }

    function CriarCuidador() {
        navigation.navigate('tCadastroInfoC');
    }

    function Voltar() {
        navigation.goBack()
    }

    return (
        <ImageBackground style={styleGeral.container}>
            <View style={styles.footer}>
                <RectButton style={styles.button} onPress={CriarUsuario}>
                    <Text style={styles.buttonText}>Cadastrar como Cliente</Text>
                </RectButton>
                <RectButton style={styles.button} onPress={CriarCuidador}>
                    <Text style={styles.buttonText}>Cadastrar como Cuidador(a)</Text>
                </RectButton>
                <RectButton style={styles.buttonReturn} onPress={Voltar}>
                    <Text style={styles.buttonText}>Voltar</Text>
                </RectButton>
            </View>
        </ImageBackground>
    );
}
